
// Contenido del popup para cada feature
function popupContentAguaRed(feature) {
    return (
        "<div id='Estilo1'><h3>Descripción</h3></div>" +
        "<hr class='hrx' style='color: #ef7d26;' align='left' noshade='noshade' size='1' width='100%' />" +
        "<div id='Estilo3a'>" +
        // "<b> Provincia : </b>" + feature.properties.PROV + "<br>" +
        "<b> Departamento: </b>" + feature.properties.nam + "<br>" +
"<b> % Hogares con Agua de Red: </b>" + feature.properties.value + "<br>" +
// "<b> Total Pob. Provicial con NAF : </b>" + feature.properties.suma_NAF + "<br>" +
"<b> Fuente: </b> Elaborado a partir de CENSO 2022" + "<br>" +
"<b> Fecha:  2022 </b>" + "<br>"+
        "</div>"
    );
}
function getColorAguaRed(value) {
    {
        if (value >= 0 && value <= 44.4) return "#f7fbff";
        if (value > 44.5 && value <= 65.4) return "#c8dcf0";
        if (value > 65.5 && value <= 81.3) return "#77b4d8";
        if (value > 81.4 && value <= 92.7) return "#2979b9";
        if (value > 92.8 && value <= 99.99) return "#08306b";
       
    }
};

function styleAguaRed(feature) {
    return {
        fillColor: getColorAguaRed(feature.properties.value),
        weight: 1,
        opacity: 0.9,
        color: '#292828',
        dashArray: '0',
        fillOpacity: 0.9,
        stroke: '#232323',
    }
}

// Función para generar la leyenda
function createLegendAguaRed() {
    var legend = L.control({ position: 'bottomright' });

    legend.onAdd = function () {
        var div = L.DomUtil.create('div', 'info legend');
        var labels = [];

        var styles = [
            { label: '% Hogares con Agua de Red', color: '' },
            { label: '0 - 44.4', color: '#f7fbff' },
            { label: '44.5 - 65.4', color: '#c8dcf0' },
            { label: '65.5 - 81.3', color: '#77b4d8' },
            { label: '81.4 - 92.7', color: '#2979b9' },
            { label: '92.8 - 99.9', color: '#08306b' },
           
            // Agrega aquí el resto de estilos con su respectiva etiqueta y color
        ];

        // Genera el contenido HTML de la leyenda
        styles.forEach(function (style) {
            labels.push(
                '<i style="background:' + style.color + '"></i> ' + style.label
            );
        });

        div.innerHTML = labels.join('<br>');
        return div;
    };

    // Función para mostrar/ocultar la leyenda
    function toggleLegend() {
        if (map.hasLayer(AguaRED)) {
            legend.addTo(map);
        } else {
            legend.remove();
        }
    }
// Eliminar la leyenda al inicio
legend.remove();
    // Escucha el cambio de estado de la capa
    map.on('overlayadd overlayremove', toggleLegend);
}




